import React from "react";
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

// Establece las fuentes de pdfMake
pdfMake.vfs = pdfFonts.pdfMake.vfs;

const imageBase64 =
  "data:image/png;base64,";
function generateInvoice(data) {
  const documentDefinition = {
    content: [
      // Encabezado con informacin a la izquierda y derecha
      {
        columns: [
          {
            width: "50%",
            stack: [
              { image: imageBase64, width: 150, margin: [-10, -60, 0, 0] },
              {
                text: [
                  "1234 Business St, Suite 100\n",
                  "City, State, ZIP\n",
                  "Phone: (123) 456-7890\n",
                  "Email: info@company.com",
                ],
                style: "companyInfo",
              },
            ],
          },
          {
            width: "50%",
            text: [
              { text: "Invoice Date: ", bold: true },
              new Date().toLocaleDateString(),
              "\n",
              { text: "Invoice Number: ", bold: true },
              "INV-00123",
              "\n",
              { text: "Due Date: ", bold: true },
              new Date(new Date().setDate(new Date().getDate() + 30)).toLocaleDateString(),
            ],
            style: "invoiceInfo",
            alignment: "right",
          },
        ],
        margin: [0, 20, 0, 20],
      },

      // Ttulo de la Factura
      {
        text: "Reporte de Materias Primas",
        style: "invoiceTitle",
        alignment: "center",
        margin: [0, 0, 0, 20],
      },

      // Informacin del Cliente
      {
        text: "Bill To:",
        style: "subheader",
        margin: [0, 0, 0, 10],
      },
      {
        text: [
          "Customer Name\n",
          "Customer Address Line 1\n",
          "Customer Address Line 2\n",
          "Customer City, State, ZIP\n",
          "Customer Phone: (987) 654-3210",
        ],
        margin: [0, 0, 0, 20],
      },

      // Tabla de productos o servicios
      {
        table: {
          headerRows: 1,
          widths: ["*", "auto", "auto", "auto"],
          body: [
            [
              { text: "Item", style: "tableHeader" },
              { text: "Quantity", style: "tableHeader" },
              { text: "Price", style: "tableHeader" },
              { text: "Total", style: "tableHeader" },
            ],
            ...data.map((item) => [
              item.name,
              item.quantity,
              `$${item.price.toFixed(2)}`,
              `$${(item.quantity * item.price).toFixed(2)}`,
            ]),
            ["", "", "Subtotal", `$${data.reduce((sum, item) => sum + item.quantity * item.price, 0).toFixed(2)}`],
            [
              "",
              "",
              "Tax (10%)",
              `$${(data.reduce((sum, item) => sum + item.quantity * item.price, 0) * 0.1).toFixed(2)}`,
            ],
            [
              "",
              "",
              "Total",
              `$${(data.reduce((sum, item) => sum + item.quantity * item.price, 0) * 1.1).toFixed(2)}`,
            ],
          ],
        },
        layout: {
          fillColor: "#f2f2f2",
          hLineWidth: () => 1,
          vLineWidth: () => 1,
          hLineColor: "#cccccc",
          vLineColor: "#cccccc",
          paddingLeft: () => 10,
          paddingRight: () => 10,
        },
        margin: [0, 0, 0, 20],
      },

      // Notas o mensajes adicionales
      {
        text: "Thank you for your business!",
        style: "footer",
        alignment: "center",
        margin: [0, 20, 0, 0],
      },
    ],

    // Estilos
    styles: {
      header: {
        fontSize: 24,
        bold: true,
        color: "#333",
      },
      companyInfo: {
        fontSize: 12,
        color: "#555",
      },
      invoiceTitle: {
        fontSize: 20,
        bold: true,
        color: "#333",
      },
      invoiceInfo: {
        fontSize: 12,
        color: "#555",
      },
      subheader: {
        fontSize: 16,
        bold: true,
        margin: [0, 0, 0, 10],
      },
      tableHeader: {
        fillColor: "#007BFF",
        color: "#ffffff",
        fontSize: 12,
        bold: true,
      },
      footer: {
        fontSize: 12,
        color: "#555",
      },
    },
  };

  pdfMake.createPdf(documentDefinition).download("invoice.pdf");
}

function Test() {
  const invoiceData = [
    { name: "Product 1", quantity: 2, price: 30 },
    { name: "Product 2", quantity: 1, price: 20 },
  ];

  return (
    <div>
      <button onClick={() => generateInvoice(invoiceData)}>Generate Invoice</button>
    </div>
  );
}

export default Test;
